class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        m,n = len(board), len(board[0])

        max3 = [[] for _ in range(m)]

        for i in range(m):
            temp = [(b, j) for j,b in enumerate(board[i])]
            temp.sort(reverse= True)

            max3[i] = [temp[j][1] for j in range(3)]


        ans = -10 **18
        for i in range(m):
            for _i in range(3):

                for j in range(i+1, m):
                    for _j in range(3):

                            for k in range(j+1, m):
                                for _k in range(3):

                                    if max3[i][_i]!= max3[j][_j] and max3[j][_j]!= max3[k][_k] and max3[k][_k]!= max3[i][_i]:

                                        res = board[i][max3[i][_i]]+ board[j][max3[j][_j]]+  board[k][max3[k][_k]]
                                        # print(i, j, k)
                                        # print(max3[i][_i], max3[j][_j], max3[k][_k])
                                        ans = max(ans, res)


        return ans
